            float PuppiMET_pt_var{*PuppiMET_pt->Get()};
            float dphillmet_var{*dphillmet->Get()};
            float mcollWW_var{*mcollWW->Get()};

            float input_layer[12] = { mll_var, dphill_var, detall_var, ptll_var, drll_var, pt1_var, pt2_var, mth_var, PuppiMET_pt_var, dphillmet_var, mcollWW_var, jet1_btag};
            for (int index = 0; index < 12; index = index + 1) { 
                input_layer[index] = (input_layer[index]-var_means[index])/var_std[index];            }
            float layer0[60] = { 0 };
            for (int next_index = 0; next_index < 60; next_index = next_index +1) { 
                for (int last_index = 0; last_index < 12; last_index = last_index + 1) { 
                    layer0[next_index] += weight_0[next_index][last_index] * input_layer[last_index]; 
                }
                layer0[next_index] += bias_0[next_index]; 
                layer0[next_index] = layer0[next_index] > 0 ? layer0[next_index] : 0; // RELU 
            }
            float layer1[30] = { 0 };
            for (int next_index = 0; next_index < 30; next_index = next_index +1) { 
                for (int last_index = 0; last_index < 60; last_index = last_index + 1) { 
                    layer1[next_index] += weight_1[next_index][last_index] * layer0[last_index]; 
                }
                layer1[next_index] += bias_1[next_index]; 
                layer1[next_index] = layer1[next_index] > 0 ? layer1[next_index] : 0; // RELU 
            }
            float layer2[15] = { 0 };
            for (int next_index = 0; next_index < 15; next_index = next_index +1) { 
                for (int last_index = 0; last_index < 30; last_index = last_index + 1) { 
                    layer2[next_index] += weight_2[next_index][last_index] * layer1[last_index]; 
                }
                layer2[next_index] += bias_2[next_index]; 
                layer2[next_index] = layer2[next_index] > 0 ? layer2[next_index] : 0; // RELU 
            }
            float layer3[10] = { 0 };
            for (int next_index = 0; next_index < 10; next_index = next_index +1) { 
                for (int last_index = 0; last_index < 15; last_index = last_index + 1) { 
                    layer3[next_index] += weight_3[next_index][last_index] * layer2[last_index]; 
                }
                layer3[next_index] += bias_3[next_index]; 
                layer3[next_index] = layer3[next_index] > 0 ? layer3[next_index] : 0; // RELU 
            }
            float layer4[4] = { 0 };
            for (int next_index = 0; next_index < 4; next_index = next_index +1) { 
                for (int last_index = 0; last_index < 10; last_index = last_index + 1) { 
                    layer4[next_index] += weight_4[next_index][last_index] * layer3[last_index]; 
                }
                layer4[next_index] += bias_4[next_index]; 
            }
            float max_final_layer = layer4[0];
            for (int index = 0; index < 4; index = index +1) { 
                if(layer4[index] > max_final_layer){
                    max_final_layer = layer4[index];
                }
            }
            float softmax_denom = 0; 
            for (int index = 0; index < 4; index = index +1) { 
                softmax_denom += expf(layer4[index] - max_final_layer); 
            }
            float softmax_output[4] = { 0 }; 
            for (int index = 0; index < 4; index = index +1) { 
                softmax_output[index] = expf(layer4[index] - max_final_layer - log(softmax_denom));
            }
            if(strcmp(name_.c_str(), "ggH_OFF") == 0) {
                return (double) softmax_output[0];
            }
            if(strcmp(name_.c_str(), "ggH_ON") == 0) {
                return (double) softmax_output[1];
            }
            else if(strcmp(name_.c_str(), "top") == 0) {
                return (double) softmax_output[2];
            }
            else if(strcmp(name_.c_str(), "WW") == 0) {
                return (double) softmax_output[3];
            }
            else if(strcmp(name_.c_str(), "MAX") == 0) {
                float max_index = 0;
                float max_value = softmax_output[0];
                for (int index = 1; index < 4; index = index +1) {
                    if(softmax_output[index] > max_value){
                        max_index = index;
                        max_value = softmax_output[index];
                    }
                }
                return (double) max_index;
            }
            return -1.0;

